日用品／オーラルケア／歯ブラシ<br>エビス プレミアムケアハブラシ・コンパクト やわらかめ<br>ぎっしりブラシでしっかり磨ける歯ブラシです。6列の幅広ヘッドで、穴数は従来品と比べて約1.7倍。植毛量が多く、歯との接触面積が広いので、いつものブラッシングで簡単に効率よく歯垢を除去できます。外側のソフト毛が歯ぐきをやさしくいたわり、内側のハード毛が歯面をしっかり磨きます。<br><br>※色はレッド・ブルー・ホワイト・ブラックとございますが、色・柄は選べませんのであらかじめご了承ください。 <br><br>ご注意：<br>●歯ぐきを傷付けないように、軽い力で磨きましょう。<br>●毛先が開いたらとりかえましょう。  <br><br>品質表示<br>●柄の材質：ポリプロピレン<br>●毛の材質：飽和ポリエステル樹脂<br>●毛のかたさ：やわらかめ<br>●耐熱温度：80度 <br><br> 原産国：日本<br><br> お問い合わせ先：<br>エビス株式会社お客様フリーダイヤル：0120-37-0791  <br><br>販売_製造元： エビス<br>ブランド：プレミアムケアハブラシ<br>JAN：4901221800003<br><br>CS：360<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
